var acs_cache = {
    "340001": "The Acting Grand Master's life runs like the gears of a machine, driven by the great force of heavy responsibility, constantly being ground down by work.<br>Over time, the armor of chivalry has become like Jean's second skin, the presentation of proper dress code and a formal image becoming ever more firmly forged into her nature.<br>But in truth, Jean is no older than the ordinary young women around her.<br><br>In the novels that these young ladies enjoy, gorgeous gowns are as quintessential as sun, moon, and starlight themselves, and some opulent noble scions do indeed sit pretty in dresses that sprawl out like palaces, their hem-lines and long skirts intertwined like the lapping waves of the sea.<br>Perhaps Jean once had such romantic aspirations too. After all, who has never hankered after the blissful beauty of luxury?<br><br>But now, Jean has had her wish granted with a set of form-fitting summer wear made just for her — and this one item has far surpassed any number of beauteous dresses that appeared in her novels.<br>\"I heard that the original idea was Barbara's and that she and Lisa searched every store before deciding on the most suitable design.\"<br>\"Then Kaeya was somehow able to convince Master Diluc to hire craftsmen to make some modifications...\"<br>\"...With fabric chosen by Amber out of her experience with making Baron Bunnies, to render it comfortable but relatively inexpensive...\"<br>\"...And with gems for decoration picked from Albedo and Klee's collections.\"<br>\"The tailoring was then overseen by Noelle, right down to the last needle and thread...\"<br>\"...And the detailed dimensions were provided by Lisa, who even sewed this lovely rose ornament on personally...\"<br>This gift, made for her by everyone, was the loveliest surprise she had ever had.<br><br>If her previous holiday was a tiny respite amidst a sea of work, this seaside trip was an unexpected opportunity to fully relax.<br>Having laid her armor aside, she now shimmered in the sea's light like a twirling dandelion.<br>\"This... is the first time I've ever had such a relaxing summer holiday.\"",
    "340000": "Barbara's songs and dances are meant to heal everyone's hearts.<br>But sometimes, even Barbara, who brings smiles onto everyone's faces, will herself feel down.<br>She, too, wishes to hang out with close friends and spend quality time with her family, much like any other girl her age.<br>These small wishes seem simple to anyone else, but they are a luxury for Barbara.<br><br>As an idol, she is often surrounded by zealous fans when she goes out.<br>And when she can steal moments to be with her family, the time she can spend with her parents and sister is ever so brief.<br>Her brilliant, busy sister is often stuck to her desk due to official business, and every time Barbara wants to go to her to share her feelings, she is silenced by the mountain of work piled in front of Jean.<br><br>Her sister's exhaustion is plain to see, and Barbara sees it too.<br>It can't be helped: Jean Gunnhildr is everyone's Acting Grand Master.<br>\"But... could you just... give me my sister back, just for a while?\"<br>Barbara says this to herself while watching her busy sister.<br><br>And that was when she heard a rumor about a strange archipelago.<br>Summer, islands, the ocean... could this be her hard-come-by opportunity?<br>Summer meant refreshing drinks, sweet icy desserts, and golden sands, azure seas, and people playing in the water.<br>The sand... the sea... Yes! So it was decided.<br><br>But a seaside trip requires preparation.<br>Snacks, sweets... ah yes, and Spicy Dried Fish, too. All this, she placed into her cute yellow ducky bag. ♪<br>Oh, and let's not forget clothes! I'll need some light and comfy swimwear. This short skirt looks good — and those little white flowers lend a playful look to those shoes! ♪<br>And perhaps a little bow tied around the neckline, would that look cuter?<br>Barbara began to hum happily to herself: La~ la la la la~ la la! ♪<br><br>But there was no way her sister would have time to prepare any swimwear for herself, would she?<br>That was quite the pickle... Still, there were ways around that.<br>Barbara pushed the door of the library open with a smile. \"Do you have time, Miss Lisa? I'd like your help with picking a set of clothes.\"",
    "340002": "Ningguang, the great mover and shaker of Liyue's mercantile spheres, always seems to have a confident, steady smile on her face.<br>But even she cannot escape the vagaries of depression, reluctance, loneliness, and other anxieties that trouble the ordinary people of Liyue.<br>Once, when Liyue Harbor teetered on the brink of a crisis, Ningguang was forced to sacrifice her Jade Chamber — the sky palace she had built up for many years through much sweat and tears.<br>All the memories of her past, sweet or bitter, were cast into the ocean with the Jade Chamber, and there they sank. Even one such as Ningguang could nary bear the loss.<br>Even after the dust had settled and the opportunity to rebuild the Chamber came, she still spent much time in troubled consideration.<br>Many things happen in this world — who could say when great loss might loom?<br>Each time she thought on this, she would feel depressed.<br><br>As the banquet in the skies began anew, Ningguang stepped forward in her indigo dress to invite the gathered guests to celebrate with her.<br>Yet amid the revelry, amidst the sea of famous relics, precious trinkets, fine cuisine, and the cries of joy and laughter,<br>Liyue's Tianquan was once again gripped by melancholy.<br><br>Leaving her seat, she stood under the night sky with a clouded heart.<br>The sounds of cheer within the pavilion could no longer be heard from this far away — it was as if she were alone under the stars.<br>As she often would in past, she gazed down at Liyue beneath her feet—<br>The faint moonlight seemed to be cast about Liyue's face like a veil. From Bishui Plain to Lisha, the land was painted a magnificent, gentle white.<br>This was a sight that Ningguang was most familiar with. Ever since the Jade Chamber was completed, she would gaze upon this majestic view every night.<br>Time flies, but the mountains and seas remain.<br><br>\"The mortal world is fleeting, but there are things that will not change so easily.\"<br>\"A hundred years from now, perhaps, all things might be different. But then, my beauty would have faded, my body reduced to withered bones.\"<br>\"This garment, too, will by then have grown dull, no matter how opulent it may have been in its prime.\"<br>\"But so long as I live, riches uncounted shall be at my disposal, as shall the Tianquan's authority, so vested in me.\"<br>\"I will live this life to the full — lacking not at all for power, wealth, or friends.\"<br>\"Was this not what I resolved to do from the beginning? If so, then how could I simply allow myself to fall into this pit — to lose my wits because of a moment's emptiness?\"<br>\"Life must be treasured precisely because it is fleeting.\"<br>\"But a thousand, even ten thousand years from now, those who come after will remember this name — Ningguang.\"<br><br>As she returned to the feast, her heart was clear.<br>And when she emerged before the crowd again, the Tianquan Ningguang wore that calm, self-assured smile once more.",
    "340003": "Satins with an exquisite texture weaved with ancient techniques and made from carefully selected petals of half-blooming Silk Flowers; dye extracted from Violetgrass of purest mulberry, ideal for recreating the ethereality of ancient paintings; something Liyue and something exotic fused together to create a unique style, with interlaced threads sewn through a hundred days of work, fine like gossamer brush strokes across a canvas.<br>The dress is perhaps Keqing's most luxurious outfit. The story behind it is also rather fascinating—<br>Since her first day as the Yuheng, she has never enjoyed its privileges but has instead devoted much private time to her duty. To improve work efficiency, Keqing prefers a dressing style that prioritizes practicality and only keeps a minimum level of embellishment. Therefore, though like a flower she blooms, she used to dress simple.<br>However, working closely with Ganyu and then Ningguang has given Keqing a sort of epiphany—<br>Keqing accepts that she cannot work day and night like the half-adeptal secretary Ganyu. She also knows Ningguang's way well, who often takes a bath after work to withdraw from the moment. By temporarily putting the crazy agenda aside for the next day, Ningguang thus allows herself to fully relax.<br>Keqing understands that to lead the tide of change requires not impatient leaps and bounds but care for one's body and mind. Good maintenance keeps one going smoothly.<br>Ningguang also gave Keqing similar advice:<br>\"You've never donned anything special for festivals, and people are used to your image as it is. But Liyue is different now. If you show up in front of the public in a new look, it will add to the merrymaking and inspire everyone greatly.\"<br>Keqing was aware of that, but she just wanted to transform silently so that she wouldn't worry her colleagues.<br>Her attire for the Lantern Rite would serve as a good start.<br>\"This attire marks the line between my work and life. By striking a balance between the two, I will find a comfortable pace at which I shall lead the way into a new Liyue.\"<br>Having made up her mind, Keqing had Ningguang's personal tailor make her a dress that still keeps luxury to a minimum. With the attire finished, Keqing threw herself back into the preparations for the Lantern Rite.<br>As for how she ended up overworking herself again, accidents like that do happen, occasionally.<br>While conversing with the Traveler again in the Jade Chamber, their caring advice reminded Keqing of the decision she had made not long ago. A faint smile formed on her face.<br>Perhaps this is what they call the tacit understanding between ideal companions, who are always on the same page.<br>She put on the long-readied attire and spoke gently to the Traveler, who looked her way. Having received generous praises, she turned to the blooming fireworks.<br>The light of festive fireworks set her dress aglow like a star in a dark night. The hem of her dress danced at her steps like flowers flowing in a gentle breeze.",
    "340006": "\"Big Sis, these clothes are yours, right? I found them while sorting things out in the room...\"<br>The folded ceremonial clothes in Barbara hands had the Knights' crest on it, which shone with a golden light as it caught the sun's rays.<br>It looked familiar, true, but Jean was very sure that she had never owned such a set of clothes before.<br>Come to think of it, the uniform she usually wore was hand-sewn by her mother.<br>\"Wait... could that be yours, Mother?\"<br><br>Frederica smiled as her daughter asked this question — a rare sight to see on her face.<br>\"Ah, it's been so long. So, Seamus still kept it, huh?\"<br>\"These were the clothes I wore when they granted me the title of 'Alder Knight.' You can take them, if you don't mind.\"<br>The seedlings of yesteryear have grown strong, and with their shade they shelter the land they know so well.<br>The glories of the past have been passed on, and they shine ever brighter for it.<br>They saluted each other first as knights would — then immediately embraced as only family long-overdue for a reunion might.",
    "340007": "In the last three months, Amber has had a bone or three to pick with Wolfhooks. While out scouting, her uniform and stockings were torn by their sharp hooks, and unfortunately, her schedule was such that there was no time to get them fixed.<br>The Knights' logistics division gave her 3 sets of uniform of the same type initially, so wearing one out was not exactly a major emergency. But Amber loved those three sets quite dearly, and would have been quite upset regardless of which one was torn.<br>Even Baron Bunny had his design based on these uniforms — Amber recalled, with a twinge of sadness.<br><br>So when her mission ended, Amber would attempt to sew the damaged uniform back together, but despite her excellent skills, the marks of her needlework remained stitched into the fabric.<br>However, Amber would obtain a new uniform not half a month later at the Knights' end-of-year meeting.<br>It was a fair bit more official, the craft was more ornate... And it was also stated to be more hook-proof than the previous version.<br>\"On behalf of the Knights of Favonius, I'd like to present you, our one and only Outrider, with some new clothes! Thanks for all you've done for us so far.\" So Hertha, their logistics captain, had said.",
    "340008": "By the time you arrived at Starsnatch Cliff, Mona had already been waiting for you for some time.<br>She was looking up at the starry sky, a song you did not recognize on her lips. As you approached, a sudden urge to prank her came over you... But even as you crept up, angling to clap her on the shoulder, she stopped singing.<br>\"If you were trying to scare me, I'm afraid you're too late.\"<br><br>Ah, as one might have expected from Mona Megistus, the Astrologist. Your attempt foiled, you could only sit beside her. Clearing her throat, Mona began to speak in a professorial tone—<br>\"The stars are truly lovely today, making this a fine night to watch the sky. And now that I've convinced the couple who are usually here to leave, this is now the perfect spot to conduct our class on the 'Basics of Astrology.'\"<br>Huh. So that was why you hadn't seen Marvin or Marla.<br>\"Then let's begin.\"<br>\"'Astrology' is an umbrella term for the study of the laws that govern the movements of matter. The celestial bodies are but a shallow subject of research in this regard...\"<br>You understood the basic preamble just fine, but as she continued to speak, the topic grew more complicated, and you started to lose the plot. Still, she spoke so enthusiastically about the subject that you could not bring yourself to interrupt.<br>Looking at her bright gray eyes and her constant gesticulations, you couldn't help but feel some embarrassment... Wait a moment.<br>\"Did you change your clothes?\"<br>Seeming not to expect your question, she seemed a little put on the spot at first, though she recovered quickly.<br>\"That's right. I'm wearing these new clothes just to commemorate this momentous occasion as your astrology teacher. You can take this as a sign of... uh, respect.\"<br>Feeling a little guilty, you told yourself to get serious. Slapping the sagging, sleepy cheeks of yours, you forced your eyes open and continued listening to her lecture.<br>\"The laws of matter are actually very simple. Rather, it is the principles that govern humanity that are the most complex. As such, we astrologists...\"<br>All the while, you thought to yourself, don't fall asleep, don't fall asleep, don't... Zzz...<br>\"Heh. What am I going to do with you...\" Your astrology master mutters.",
    "340009": "\"Oh, come on! Everyone got this just for you!\"<br>Barbara happily passed a wonderfully wrapped gift box to Rosaria, even as the latter looked on with a mix of suspicion and annoyance.<br><br>Tearing the packaging open, she found a note on the box cover across which elegant script flowed like music.<br>\"Dear Sister Rosaria, we have asked Ms. Barbara to send this gift to you, but please, do open it somewhere where she can't see you.\"<br><br>Opening the box with her back turned, Rosaria discovered that the box contained still another note. It was thusly written in the same hand as before:<br>\"Dear Sister Rosaria, we know that you don't appreciate having too many people know your birthday. However, this piece of information was written on your resume by Grandmaster Varka, so, on this important day, do allow the Church of Favonius to send you a new uniform, made just for you.\"<br>\"If you're alright with it, stop being so aloof and be a normal Sister for once.\"<br><br>Deacon Dahlia (This letter was written at the request of Sister Victoria)",
    "340004": "As the eldest son of the Ragnvindr Clan and the youngest Cavalry Captain in the history of the Knights of Favonius, much was always expected of Diluc, who grew up surrounded by plaudits and applause. Even the carefree Knight of Boreas, Varka, praised him, calling him \"the pride of the Knights.\"<br>This was a matter of great comfort to his father, Crepus, who hoped that Diluc would be more successful than him. Not only would he bring dawn to Mondstadt as a member of the Ragnvindr Clan, but he would also become an excellent Knight of Favonius, standing at the apex of the crowd, inheriting and passing its noble traditions down.<br>This expectation would bleed into their conversations, into training, and into every little detail of life, with the proud father even having a ceremonial uniform tailored for Diluc well in advance.<br>Yet, for Diluc, his father's praises and his life as a knight were extinguished forever on that gloomy, rainy night, and the ceremonial garment thus lost its purpose.<br>Many years later, the tragedy and the uproar had finally stabilized. Returning home, Diluc began his journey of \"reckoning.\"<br>This was not merely for his father's sake, but also on account of the convictions he had suffered much to gain. He would protect Mondstadt in his own way.<br>The ceremonial uniform of yesteryear was modified to serve as new cladding for battle. The fabric itself was familiar yet had the feeling of long-separation, and Diluc privately treasured it.<br>\"That's my boy.\" Looking upon the gem around the neck that reflected his red hair, he recalled his father saying that.<br>On silent nights, the edge hidden under the velvet glove of the noble princeling will be unsheathed to counter any threat. And wherever the blade passed, wherever the claymore's arc flashed, raging flames would arise and burn the hidden nests of villainy to the ground.<br>By the time the name of the Darknight Hero had become well-known to the people of Mondstadt, the red so striking that it might sear the eyes had long become a thing of awe and terror to monsters and crooks alike.<br>\"The true dawn has yet to come.\"<br>Contrary to his father's expectations, Diluc knew that he must instead be a \"forerunner.\"",
    "340005": "—Curtains Rise—<br>O holiest of sovereigns, high princess of Immernachtreich!<br>Praise her eminent rule, extol her magnanimous judgment, exalted be her rosy visage.<br>The thunder roars for her, and for her are towers built.<br>The fief-lords of Immernachtreich and The Great Sekretär, most loyal Ozvaldo Hrafnavins, gather here to await her command.<br>And her knights, silent and stern as the majestic mountains.<br>The first, the Knight of Valor, armed with a sword of keenness unmatched, yea, enough to sunder dragonscale.<br>The second, the Knight of Sincerity, shod in armor true, enough to withstand the storm of a dragon's wings.<br>The third, the Knight of Charity, righteous and pure in all ways, who quailed not before any darkness.<br>And the other knights gathered behind them, their heads bowed beneath the tower summit, gathered at their Prinzessin's feet.<br>And as for the Prinzessin, she withdrew her gaze from the deep night before addressing her servants:<br>\"Valor, Sincerity, Charity, my most excellent subjects. Follow me unto eternity.\"<br>\"For I am the noblest soul in all the Immernachtreich. So long as my heart beats, I shall never forsake you.\"<br>And the knights obeyed her:<br>\"Our swords and armor are yours. May they be for you a means to break all shackles and guard against all corruption.\"<br>\"Our true hearts also we give unto you, that they may defend your noble soul.\"<br>This was their knightly oath, and they would be by her side as she hunted the wicked dragon Tasraque.<br><br>For far away, black-hearted Tasraque had ripped and devoured the all-protecting night sky and set up its lair.<br>It had slithered in the dark, sharpening its fangs and claws, and with its flaming breath it had scorched the Prinzessin's heart, turning her eyes red.<br>This was the Prinzessin's fated foe, and their showdown was inevitable.<br>But the prophecy of fate has already been foretold. Fair and pure souls need not fret.<br>Simply open one's eyes and prepare to bear witness, for she shall surely return victorious.<br>—Curtains Fall—<br>Note: According to Flowers for Princess Fischl, Princess Fischl has \"crimson eyes like rubies.\" The actor who plays her is thus advised to make the necessary performative adjustments to maintain faithfulness to the source material.",
    "340010": "At the foot of the Sacred Sakura Tree, a lovely brocade mat lined the ground, an exquisite and beautifully-arranged meal awaiting atop it.<br>Such was the view that met your eyes when you followed the invitation letter's instructions guiding you to what it called a \"picnic.\"<br>Moments after, Kamisato Ayaka, the organizer of this picnic, emerged from behind the tree, smiling with a fan in hand and unhurried of gait.<br>\"I've heard that the people of Fontaine enjoy having picnics. I, too, wish to indulge in one such event. Perhaps I'll be able to sample the experience this novel writes of.\"<br>That was to be expected: the Yae Publishing House's newly published Fontaine light novel, \"The Case Files of Miss Orith,\" had taken Inazuma by storm of late, after all.<br>Ayaka had been reading this novel too. From time to time, the two of you would meet and discuss the methods of deduction used within the novel, revealing her deep appreciation for the entire series.<br><br>With her hair coiled up and wearing an elegant lady's hat, she looked just like the Fontaine beauty described in the novel.<br>You found the transformation amazing — though the figure before you was obviously still Ayaka, she had achieved a new sort of elegance merely by changing her apparel.<br>The \"Dame of Fontaine\" before you said:<br>\"While reading 'The Case Files of Miss Orith,' I often feel that though there might be similarities between the cultural habits of individual nations...\"<br>\"The private lives of each nation's peoples remain more different than not.\"<br>\"To appraise the lifestyle of a world beyond Inazuma is like peering at the moon's face through a veil of clouds...\"<br><br>She lowered her head, seemingly vexed.<br>As the daughter of the Yashiro Commission's Kamisato Clan, Ayaka is unable to live with the freedom comparable to that of an adventurer — this, you knew quite well.<br>Just as you were about to say something to console her, she nodded, as if experiencing an epiphany, and said:<br>\"Though such is reality, I am already vastly more fortunate than most.\"<br>\"With a friend like you, even though I cannot travel, the stories I have heard are no longer limited to Inazuma's borders.\"<br>\"...I wish that everyone — not just me — could know more about what lies beyond our shores.\"<br>So, Ayaka hadn't been distressed on her own account, it seemed.<br>\"Miss Aratani once told me that, beyond the bounds of Inazuma, learning and art flourishes in Sumeru, Mondstadt, Liyue, and Fontaine.\"<br>\"Yet, we know so very little of them...\"<br>\"I intend to propose to my brother and Lady Yae that we bring in more pieces of work from outside Inazuma!\"<br>\"Perhaps we can get a glimpse of places and peoples we've never witnessed before by using their literary works as windows...\"<br>Ayaka's bearing far exceeded your expectations — this was, indeed, the \"Shirasagi Himegimi\" of the Yashiro Commission's Kamisato Clan.<br>\"...Before I can propose this to my brother and Lady Yae, however, I must create a specific list of books to be published. As such, I wanted to ask you for some recommendations.\"<br>Before you realized it, moved as you were by her words, Ayaka had already begun touching upon the particulars of her plan.<br>After a moment of deep reflection, you put words to paper and fill the first line of the list in.<br>\"'The Boar Princess'?\"<br>\"Indeed,\" you reply. \"It's a beautiful and cruel fairy tale — rather different from other works of its kind. I think people will find it very interesting.\"<br>Unfortunately, when Ayaka brought the list of books to Aratani, the editor crossed out \"The Boar Princess\" without hesitation.<br>\"Ahem. This fairy tale might be a bit too... unique. I fear that people might not be ready for its contents yet...\"",
    "340011": "In the eyes of ordinary people, just as flowers differ in rarity due to the nature of their growth, so too do academic achievements differ in worth.<br>Certain researchers of exemplary capabilities are compared to \"Padisarahs,\" while those with more common accomplishments are regarded as akin to the more widely seen \"Mints.\"<br>As time passed, some students also found themselves influenced by these analogies. Thus, they began to use different species of flowers as amusing nicknames for each other.<br>It was unanimously agreed that the Akademiya was full of \"Sweet Flowers\" and \"Mints,\" but \"Roses\" and \"Padisarahs\" were individuals of vanishing rarity.<br>Thus, it was baffling to many that the genius Lisa Minci possessed all the qualities of a \"Padisarah\" but cared little even to claim the title of \"Rose.\"<br>As an academic, she finished a great many projects left incomplete by those who came before her, and also possessed a solid grasp of theory.<br>Her accomplishments earned her the regard of her instructors, and soon she was allowed to study even the most complex of topics. In little time, she began contributing to the advancement of her new studies as well.<br>At that time, certain researchers even thought that she could become the youngest sage in history — provided she made a few adjustments to her field of study, of course.<br>Yet, she didn't participate in the official signing ceremony that would certify her academic accomplishments, choosing instead to withdraw from the main project she was studying in her Darshan, before leaving the Akademiya altogether.<br>When faced with the confusion radiating from her classmates' questions, she merely replied as elegantly and affably as she always did:<br>\"My work can be compared to rearranging a mess of books and putting them all back in their rightful place, that's all. With that in mind, it's unnecessary for me to claim something so serious as an official title.\"<br>\"Also, do you remember that song that was so popular amongst us students?\"<br>\"'We beg not for the Kalpalata Lotus' mystery, we struggle not to claim the Padisarah's purity.'\"<br>\"'For with poetry by our sides, their fragrance ever lingers in our lives.'\"<br>\"In times past, the rose was a flower precious without peer. But after generations of scholars worked tirelessly to cultivate them, roses can now be found wherever the sunlight shines.\"<br>\"But is this bad for the roses? Well, of course not. Rare or common, the roses remain as fragrant as ever. Their preciousness was but a label we gave them.\"<br>\"As such, if there comes a day when everyone ceases to regard these flowers so subjectively and instead judges them with consideration to their growth habits and choice of environments... That day's coming, I think, might be something worthier of commemoration.\"",
    "340012": "The soft fabric is like a perfectly baked cake. The primary color is that of luxurious cream, embroidered with intricate patterns. The dark brown of the hat, gloves, and skirts have a rich chocolate-like texture. The fiery red that belongs only to Klee is like a crown of candles, shining with flame incandescent.<br>The tiny little Spark Knight, after an adventure in which even the clouds and trees could not help but dote upon her, has transformed with a flourish into the new \"Red Velvet Mage.\"<br><br>\"To a mage, what is the most important thing?\"<br>After returning to Mondstadt, two knights, one large and one small, are sitting on the city wall, watching the windmills lazily turn as they chat...<br>Though Klee had heard the title \"mage\" before, but after hearing the stories of that fiery mage, the word slowly gained its own special significance to her.<br>She remembered that adults often spoke of important things linked to one's identity... perhaps they are called \"responsibilities\"?<br>The Dagger Bandit grinned mysteriously, and shook the wine bottle in his hand:<br>\"A mage is called a mage because they can use that mystifying force called magic.\"<br>\"The most important thing for a mage is to think about how to use the awesome power of their magic.\"<br>\"The fiery red mage from all those years ago used her magic to fulfill the wishes of others, and created this refreshing paradise in the desert. The people sing her praises, and write her into their happiest stories, and she is a source of happiness and laughter.\"<br>\"Perhaps, somewhere in the world, there are capricious mages with fearful tempers, or those who have been changed by terrible tragedy. Those mages may use their magic in the wrong ways, and make the people as angry and sad as they are...\"<br>\"Red Velvet Mage Klee, how do you plan to use your magic?\"<br>With these words, the Dagger Bandit raised his glass to softly toast the tiny mage, indicating it was now her turn to answer her own question.<br>The Red Velvet Mage shook her head softly, and the juice in her cup reflected her pure smile:<br>\"Klee... wants to make everyone really happy!\"<br>But with these words, the mage suddenly realized the problem with this desire—<br>Those who are unhappy surely have their reasons for being sad. Would a smile forced upon their lips through magic be even more painful and ugly than tears?<br>Fortunately, her little mind worked quickly, and she soon found her answer:<br>Then I'll use my magic to get rid of everyone's troubles!<br>\"For example, magic could make everyone never get sick again, and never have to worry about Mora! Everyone could eat fish for every meal, and be healthy, and just happily play all day!\"<br>But that didn't seem like enough. Klee rested her cheek in her hand, and looked out over the azure sky and white clouds in the distance:<br>\"I want... I want to hear everyone's wishes, and save them, and then use the most amazing and powerful magic, to give everyone the happiness they want the very very most!\"<br>A smile is most beautiful when it is born of happiness. The reflective waters of Cider Lake taught Klee this truth.<br>The Dagger Bandit was stunned for a moment, but as the west wind caressed them, it turned into a feeling of peace and relief:<br>\"In that case, our little Klee is going to have to try her best, isn't she? Perhaps some day, you and your magic will appear in the happiest and most joyous of all stories.\"<br>In the story, the Red Velvet Mage travels to every corner of Teyvat with her companions. Wherever they go, both troubles and bad guys recede, and poverty and suffering evaporate without a trace. Clusters of sweet flowers bloom, and are surrounded by the light of a roaring campfire, candles, and stars. The sounds of joyous song and jubilant dancing fill the air, a merry feast that never ends.",
    "340013": "\"Kaeya, why does the Dagger Bandit always carry daggers?\"<br>Within the city of Mondstadt, two Knights of Favonius, one large and one small, are chatting.<br>Many days have already passed since they played the roles of bandit and mage on the stage, and even now, the small knight has questions about that which she does not yet understand.<br>*ahem* The reason the bandits carries daggers... The reason was never explained in Kaeya's script.<br>Perhaps it's because the character needed a catchy name, and the director just excitedly scrawled the words, \"the Dagger Bandit.\"<br>But the small knight in front of him sat with furrowed brow, deep in thought, more serious even than when thinking about what was for dinner.<br>The boundless curiosity of children makes them always want to ask questions. Even if the endless stream of questions can be a bit annoying for adults, if their curiosity is not satisfied, they may lose that spark of curiosity, and turn into a boring adult.<br>Of all the infinite possibilities in life, becoming boring is one of the worst and most tragic outcomes, so a child's questions should always be treated with care.<br>\"Hey, that's right, why is that? You asked a great question, Klee...\" Kaeya replied with a smile.<br><br>Perhaps because he was briefly a bandit on that stage, he too had thought about lives lived that were not his own beneath the bright lights.<br>Knights live as knights do, and bandits live as bandits must.<br>Justly taking up sword and bow and standing forth to show their determination to protect, that is a knight.<br>But hiding one's blade and closing the net on their prey in the darkness, that is a bandit.<br>Different people live in different ways. A thief will not bear the blade of a knight, and a traditional knight will not sneak out a hidden dagger to hurt someone.<br>If the characters in the story don't abide by such rules, then the story has betrayed the roles dictated by fate.<br>But there is no need to give such answers to a child, and there is never just one answer to a question.<br>The daggers used by the Dagger Bandit were gifts from his friends, or symbols of his career as a virtuous bandit, or commemorated past acts of charity...<br>Let's fabricate a fairytale, and weave heroes, legends, and beautiful fantasies together, just like each time before, and give children a dream to dream.<br>He turns around and takes the dagger from the side of the costume hanging in the room:<br>\"It's actually a complicated tale, and we'll have to start from when the big bandit was just a little kid. Would you like to hear about it, Klee?\"<br>\"Are you going to tell me another story, Kaeya? I'm listening!\"",
    "340014": "\"All children love toys.\" This was the conclusion Shenhe came to after observing Granny Shan's toy store.<br>Kites, Xiao Lanterns, and window decorations made from cut colored paper... Children in Liyue could not help but stare fixedly at them as they passed.<br>And should the adults beside them cotton on to their desire and buy that toy for them, those children would smile.<br>Shenhe possessed no such childhood memories of the sort, so she could not understand their feelings in that moment from experience. But seeing how their eyes sparkled, she believed that these toys must be related to some wondrous emotion.<br>Though she had not figured out just what this emotion might be, this beautiful possibility did soften her heart a little.<br><br>\"Shenhe seems very interested in toys.\" This was the conclusion Xianyun came to from observing Shenhe gazing at the toy store as if in a daze.<br>Her disciple, she knew, had lost her family when young, and had trained under her wing ever since, and thus opportunities to access toys had been few and far between.<br>Now that Shenhe had returned to live amongst humans, and she herself had taken their form to do so, she found as she grew more accustomed to the lives of mortals that Shenhe had indeed lacked many opportunities for joy compared to human children.<br>And was it not her responsibility as master and elder, she thought, to accompany her disciple for a jaunt at the toy store?<br><br><br>\"Master seems very fond of toys,\" Shenhe reflected as she and her master Xianyun, at the latter's insistence, spoke to Granny Shan for the sixth time.<br>In truth, she did not quite understand the charm of these little window decorations or firecrackers.<br>Her master would often use sigils to create various colorful birds to decorate her abode. They were more vivid and lifelike than these decorations, and lovelier by far. And as for the crackling and popping of the firecrackers, they were quite crude compared to the adeptal melodies she was used to.<br>In truth, the toys themselves had but limited appeal to her, for what she actually liked was the smiles on the children's faces as they looked upon them.<br>But her master seemed very interested indeed, asking about all manner of details regarding the toys, from the crafting methods to the tricks behind releasing firecrackers. Finally, her master asked her what sort of toys she liked.<br>She believed that her master's interest must have some meaning behind it, and so she answered honestly. Then, she looked upon her master's calm, thoughtful, but silent face.<br><br>\"Shenhe does not, in fact, like toys,\" Xianyun realized at last, after several visits to the toy stores.<br>If not, that gentle expression she saw on Shenhe's face as she stood in front of the toy store should have appeared at least once as she spoke with Granny Shan at length about the little imperfections in the latter's use of paper in window decorations, about improvements to firecracker casings to improve child safety, to the point she had completely earned the old lady's admiration.<br>What her disciple needed was perhaps not toys themselves.<br>A human's childhood and youth pass by in but the blink of an eye, and those who pass on shall never return. What, then, should she do as an elder?<br>Lantern Rite was fast approaching, and human custom dictated that festivals were a good opportunity to accept gifts. After all, had she not accepted just such from the Qixing in years prior...?<br>A gift... Yes, that might do.<br><br><br>Shenhe did not realize her master's intent until she and Ganyu had received their Lantern Rite gifts from her.<br>She had felt no sense of regret about standing in front of the toy store, but her master's kindness was surprising all the same.<br>It was at that moment, when she took the long dress from the gift box her master handed to her and caressed its smooth hem that she understood how those children felt upon seeing those toys.<br>Both she and her master had changed much upon coming to the mortal realm — perhaps the future held still more pleasant surprises of this sort.<br>Her future would be full of opportunities to make up for all the laughter lost and joy she had missed out on in the past. She would keep all the warmth she received in her heart, to melt the ice within her bones.",
    "340015": "Thanks to her marvelous half-adeptus constitution, Ganyu's capacity to endure hardship far surpasses the average mortal, and so she spends all year rushing to and fro on business for Yuehai Pavilion and the Ministry of Civil Affairs, her work unceasing even as day turns into night turns back into day. Naturally, she has little mind to spare for matters of personal dress, to say nothing of accessories or makeup.<br>Over time, her everyday appearance and the word \"busy\" have become tightly bound. Even when she is spotted on her brief days off, one cannot help but worriedly picture her doing overtime till she practically falls asleep standing up, or wonder if she might suddenly do an about-face and make a beeline to take care of the nearest article of urgent business.<br>Xianyun saw all this, of course, and had long been considering countermeasures. Just as well, then, that Lantern Rite was imminent, and a suggestion that she had heard on the streets came to mind:<br>\"A change of clothes may make for a change of mood...\"<br>Thus did the adeptus retrieve a machine she had sealed in storage for many years. Using it, some of her friend Ping's best Silk Flowers, and the dyes made using divine herbs from her abode, she weaved several bolts of fabric and satin of immaculate quality and color. As for the exquisite hair ornaments and pendants, they were made of the same material as her adeptal machines. Elegant, lovely, and infused with faint fragrance.<br>Then, Xianyun brought the fabric and satin to one of the finest tailors in Liyue Harbor, though she did give the poor artisan quite a fright — after all, any ordinary valuation would appraise these materials at a price point somewhere around \"couldn't get more expensive if you'd just melted Mora down and spun it into silk.\"<br>Xianyun was pleased indeed with that reaction.<br>\"One's disciple has worked many years at Yuehai Pavilion — a figure of standing and repute, surely, and more than worthy of such finery!\"<br>Of course, Xianyun did not mention the unique aspects of the fabric or the accessories when she gave Ganyu this gift, mentioning only that the tailor's craftmanship had satisfied her.<br>Nonetheless, Ganyu could intuit the value of the raiment and the thought her master put into its impeccable artisanry from how the garment seemed to flow like water in her hands.<br>And so she changed out of her usual working clothes and came out, light of heart, to meet the adeptus and her gathered friends, and at that moment her mood did quietly change—<br>As the clear starry night sky, as a tranquil scene of fragrant blossoms.<br>\"Putting duty aside to spend a carefree Lantern Rite with everyone... This, too, is an experience precious beyond measure.\"",
    "340016": "\"What? Meowndering Hero's gone missing!? At this juncture, of all times!?\"<br>The troupe leader's furious voice echoed backstage.<br>\"And right when Feiyun Commerce Guild's having important guests from Fontaine over for an evening banquet? Come on! If we run our reputation into the ground here, it's is going to be disaster for our shows on both shores of the sea!\"<br>The actor playing the \"wandering hero,\" head shrunken back in a panic, looked nothing like the part.<br>\"Th—There's still time before we take the stage. I'll go look for it right now!\"<br><br>Outside the backstage window, sitting leisurely on a corner eave, was Xingqiu.<br>\"I see, I see. So it is a matter of saving face, then, that no one from our Guild was asked to join the search? That complicates things... How, then, am I to tell them that you're here, Mr. Cat?\"<br>Standing up, Xingqiu peeped down the chimney mouth next to him — within, a black cat in swashbuckling garb stared up at him, eyes vigilant.<br>To say nothing of his own chicanery in secreting himself away from the banquet making him ill-suited to meet others directly, someone known as the \"second young master of the Feiyun Commerce Guild\" finding this 'Meowndering Hero' would make things terribly awkward for the opera troupe.<br>\"I guess I'll just have to rescue you and take you backstage in secret, huh... Ugh, I hope I don't get these clothes dirty, or my brother's going to ask some pointed questions about where I've been again...\"<br>Xingqiu reached cautiously into the chimney, but the cat ducked into a corner, rejecting his proffered helping hand.<br>\"Spooked by the unfamiliar environment? Or are you just not fond of the banquet atmosphere? Either way, Mr. Cat, getting others in hot water is not quite what a cat with your title should be doing.\"<br>He grinned wryly. No getting this kitty to come along without getting his hands dirty, huh?<br><br>The night went as planned, and the troupe took the stage without a hitch.<br>Meowndering Hero twirled and flipped to the strict rhythm of the gong, seemingly endless applause breaking out.<br>\"Amazing! Most amazing!\" Xingqiu exclaimed while grabbing onto his older brother. What grabbed said brother's attention, however, was Xingqiu's new attire.<br>This Fontainian-style ensemble's well-tailored lines were adorned with elegant bamboo patterns. Clearly, the work of a master...<br>And yet, when he had first received it, had this little lad not complained that it \"restricted movement\" and \"made it hard to conceal oneself,\" wearing it but once before folding it up and putting it back on the shelf? Where was this sudden love for it coming from?<br>As if reading the doubt written on his brother's face, Xingqiu smiled softly, saying: \"I came across this line while reading last night: 'One should make guests feel at home'... Changing into these clothes to welcome guests from Fontaine is a form of courtesy too, is it not?\"<br>The doubt knitted into the elder brother's brows dissipated, and he looked Xingqiu up and down once more. His clothes were quite clean, so he certainly didn't seem to have snuck out like he had last year...<br>Perhaps his kid brother really had matured a little this year, he thought with some relief.<br>...Still, there was a faint smell of ash in the air. Where was that coming from, exactly?<br><br>\"No need to trouble yourselves. I'll change by myself.\"<br>When the banquet was over, and the servants were sent away, Xingqiu would take his coat off, revealing his dust and dirt-stained inner garments.<br>\"Phew... That was a close one. Good thing this was in the cabinet. There was no way I was fooling my brother otherwise...\"<br>Perhaps his next novel could be about a chivalrous thief from Fontaine, then?<br>\"Hmm... Let's start with this: All know the common wisdom that damasked dress makes a deficient disguise, but none realized that celebrity was the cloak of this chivalrous thief...\""
}

